import DeleteIcon from '@material-ui/icons/Delete';

const Note = () => {
    return (
        <>
           <div className="note">
                <h1> title </h1>
                <br />
                <p> this is the content </p>
                <button className="btn">
                <DeleteIcon className="deleteIcons"/>
                </button>
           </div>
        </>
    );
};

export default Note
